import React from "react";
import { NavLink } from "react-router-dom";
import { makeStyles } from '@material-ui/core/styles';
import {
  AppBar,
  Toolbar,
  Typography,
  Button,
  IconButton,
  Menu,
  MenuItem,
} from '@material-ui/core';
import MenuIcon from '@material-ui/icons/Menu';

export default function Nav() {

  const onMenuClick = () => {
    console.log("hello")
  }

  const classes = useStyles();
  const [example, setExample] = useState("primary");
  const isCustomColor = example === "customColor";
  const isCustomHeight = example === "customHeight";

  return (
    // <nav>
    //   <NavLink exact to="/">
    //     Home
    //   </NavLink>
    //   &nbsp;|&nbsp;
    //   <NavLink to="/login">Login</NavLink>
    //   &nbsp;|&nbsp;  
    //   <NavLink to="/logout">Logout</NavLink>
    //   &nbsp;|&nbsp;  
    //   <NavLink to="/contact">Contacts</NavLink>
    //   <br></br>
    //   <hr></hr>
    // </nav>
    <AppBar
      color={isCustomColor || isCustomHeight ? "primary" : example}
      className={`${isCustomColor && classes.customColor} ${isCustomHeight && classes.customHeight}`}
    >
      <Toolbar>
        <IconButton
          edge="start"
          className={classes.menuButton}
          color="inherit"
          aria-label="menu"
        >
          <MenuIcon />
        </IconButton>
        <Typography variant="h6" className={classes.title}>
          AppBar
        </Typography>
        <IconButton color="inherit" onClick={() => setExample("default")}>
          1
        </IconButton>
        <IconButton color="inherit" onClick={() => setExample("primary")}>
          2
        </IconButton>
        <IconButton color="inherit" onClick={() => setExample("secondary")}>
          3
        </IconButton>
        <IconButton color="inherit" onClick={() => setExample("transparent")}>
          4
        </IconButton>
        <IconButton color="inherit" onClick={() => setExample("customColor")}>
          5
        </IconButton>
        <IconButton
          color="inherit"
          onClick={() => setExample("customHeight")}
        >
          6
        </IconButton>
      </Toolbar>
    </AppBar>
  );
}
